import './Login.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function PatientLogin() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const[email, setEmail] = useState("");
    const[password, setPassword] = useState("");
    const [name, setName] = useState("");
    const [dob, setDob] = useState("");
    const [gender, setGender] = useState("");
    const [phone, setPhone] = useState("");
    const navigate = useNavigate();

    // Handle choice between sign up and sign in
    const handleChoice = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }

    // Handle sign in 
    const handleSignIn = (e) => {
        // TODO: Add logic to verify patient credentials

        e.preventDefault();
        navigate('/Patient');
    }

    // Handle sign up
    const handleSignUp = (e) => {
        // TODO: Add logic to create a new patient account
        navigate('/Patient');
    }

    return (
        <div>
            <h1>Patient</h1>

            {!signIn && !signUp ? (
                <div className="account-container">
                    <button className="account-button" onClick={() => handleChoice("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleChoice("sign up")}>Create An Account</button>
                </div>
            ): null}

            {signIn ? (
                <div>
                    <form className="login-form">
                        <div className="login-form-item">
                            <label>Email:</label>
                            <input 
                                type="text" value={email} onChange={(e) => setEmail(e.target.value)}
                            />
                        </div>
                        <div className="login-form-item">
                            <label>Password:</label>
                            <input 
                                type="password" value={password} onChange={(e) => setPassword(e.target.value)}
                            />
                        </div>
                        <button onClick={handleSignIn} type="submit">Sign In</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

            {signUp ? (
                <div> 
                    <form className="login-form">
                        <div className="login-form-item">
                            <label>Name:</label>
                            <input 
                                type="text" value={name} onChange={(e) => setName(e.target.value)}
                            />
                        </div>
                        <div className="login-form-item">
                            <label>Email:</label>
                            <input 
                                type="email" value={email} onChange={(e) => setEmail(e.target.value)}
                            />
                        </div>
                        <div className="login-form-item">
                            <label>Password:</label>
                            <input 
                                type="password" value={password} onChange={(e) => setPassword(e.target.value)}
                            />
                        </div>
                        <div className="login-form-item">
                            <label>Date of Birth:</label>
                            <input 
                                type="date" value={dob} onChange={(e) => setDob(e.target.value)}
                            />
                        </div>
                        <div className="login-form-item">
                            <label>Gender:</label>
                            <select value={gender} onChange={(e) => setGender(e.target.value)}>
                                <option></option>
                                <option>Male</option>
                                <option>Female</option>
                            </select>
                        </div>
                        <div className="login-form-item">
                            <label>Phone:</label>
                            <input 
                                placeholder="123-456-7890" value={phone} onChange={(e) => setPhone(e.target.value)}
                            />
                        </div>
                        <button onClick={handleSignUp} type="submit">Sign Up</button>
                    </form>
                    <button onClick={() => setSignUp(false)}>Back</button>
                </div>
            ) : null}
        </div>
    )
}
